import "./FormPage.css";
import * as texts from "../../Utilities/textForApp";
import Button from "../../components/UI/Button/Button";

const FormPage = () => {
  const btnClicked = () => {};

  return (
    <div className="formPage">
      <h2>{texts.FORM_H2}</h2>
      <div className="form"></div>
      <div className="checkBox">
        <input type="checkbox"> </input>
              <label>{texts.FORM_CHECK_BOX_1}</label>
        {/* <input type="checkbox"> {texts.FORM_CHECK_BOX_2}</input> */}
        <Button text={texts.FORM_BTN} clicked={btnClicked} type="send" />
      </div>
    </div>
  );
};

export default FormPage;
